import React from "react";
// import { Link } from "react-router-dom";
import { Card, Container, Image, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";

import "./UserItem.css";

const UserItem = props => {
  console.log(props.image);
  return (
    <Row lg={6}>
      <Card className="bg-dark text-white">
        <Image src={props.image} roundedCircle width="400px" height="400px" />
        <Card.Title className="title__card">{props.name}</Card.Title>
        <Container className="card_center">
          <Card.Link href="#"> <Image src={require("../../img/iconProfile/heart.png")} roundedCircle width="50px" height="50px" /></Card.Link>
          <Card.Link href="#">Dislike</Card.Link>
        </Container>
      </Card>
    </Row>
  );
};

export default UserItem;
